import React from 'react';
import logo from './logo.svg';
import './App.css';
import VsProducts from './vschoolProducts';
import Product from './Product';

function App() {
  const ProductComponent = VsProducts.map(function(product){
    return (
      <Product 
        key={product.id} 
        name={product.name} 
        price={product.price} 
        description={product.description} />
      )
  })

  return (
    <div className="todo-list">
      {ProductComponent}
    </div>
  );
}

export default App;
